export function handler(data){
  data.sort((a, b) => {
    return b.cases - a.cases
  })
  const formatData = data.map(v => {
    return { name: v.country, value: v.cases }
  })
  this.setProps({
    data: formatData
  })
}

export function handler(data){
  let formatData = data.map(v => {
    const timelineKeys = Object.keys(v.timeline);
    return { name: v.country, value: v.timeline[timelineKeys[timelineKeys.length - 1]] }
  });
  formatData.sort((a, b) => {
    return b.value - a.value;
  });
  formatData = formatData.slice(0, 10);
  this.setProps({
    data: formatData
  })
}

